window.bookSummaryJSON = "<p>The Dawn Queen thinks she can steal my mates.</p> <p>I thought the bond between us would never break, but then she bewitches them into forgetting who I am and what I mean to them. At the queen's command, they hunt me like a wild beast.</p> <p>To survive, I must become more merciless than any of them, no matter how much my heart bleeds when I hurt them or how badly my body craves theirs.</p> <p>When even my forbidden magic can't bring them back, I have to make a terrible choice.</p> <p>To end the deadly game and make my mates remember me again, I'll have to leap into Hell's inferno. </p> <p>If that doesn't work? I'll burn to ashes.</p>"; 
